import functools
class Solution:
    def countPaths(self, grid: List[List[int]]) -> int:
        '''
        Turns out, the solution is way easier than I initially thought.
        Due to its phrasing, I thought it would make sense to keep track of
        all the path lengths observed.
        Actually, we only need to count any branching (DFS) and then count it again
        if a path comes from a different square.
        '''
        m = len(grid) 
        n = len(grid[0])
        modu = 10**9 + 7

        def get_neighbors_4(i,j):
            neighbors = []
            if i < m - 1:
                neighbors.append((i+1, j))
            if j < n - 1:
                neighbors.append((i, j+1))
            if i > 0:
                neighbors.append((i-1, j))
            if j > 0:
                neighbors.append((i, j-1))
            return neighbors

        path_lengths_global_plain = 0

        @lru_cache(maxsize=None)
        def dfs(i,j) -> int:
            path_lengths_local_plain = 1
            neighbors = get_neighbors_4(i,j)          
            for x,y in neighbors:
                if grid[i][j] < grid[x][y]:
                    path_lengths_local_plain += dfs(x,y)
            return path_lengths_local_plain

        for i in range(m):
            for j in range(n):
                path_lengths_global_plain += dfs(i,j)
                
        #print(path_lengths_global_plain)
        return path_lengths_global_plain % modu 

